% Tuning Method of Finite-Gain Multiple-Resonant Controllers Applied to Uninterruptible Power Supplies (UPS)
% Last change: 28/11/2018
% Author: Rodrigo Bertoldi
%
% Function to design resonant controllers gains for UPS up to four Resonant
% Modes. A set of equations determine controller gains based on the desired
% output response and the parameters of a class of UPS systems.
%
% INPUTS:
% n_har: Number of Controller Resonant Modes;
% Cf: Output Filter capacitance [F];
% Lf: Output Filter inductance [H];
% Rlf: Inductor resistance [Ohms];
% wr: Frequency of reference voltage (wr = 2*pi*f) [rad/s]; 
% YY0max: Maximum load admittance (YY0max = Pout_nom*0.7/Vout_rms^2) [S];
% Kpwm: PWM inverter is represented by a static gain multiplied by the control input;
% csip1: Damping Coefficient of the first resonant mode;
% csip3: Damping Coefficient of the second resonant mode;
% csip5: Damping Coefficient of the third resonant mode;
% csip7: Damping Coefficient of the fourth resonant mode;
% alpha_Pd(1): Coefficient of the desired characteristic polynomial;
% alpha_Pd(2): Coefficient of the desired characteristic polynomial;
% alpha_Pd(3): Coefficient of the desired characteristic polynomial;
% alpha_Pd(4): Coefficient of the desired characteristic polynomial;
% alpha_Pd(5): Coefficient of the desired characteristic polynomial;
% alpha_Pd(6): Coefficient of the desired characteristic polynomial;
% alpha_Pd(7): Coefficient of the desired characteristic polynomial;
% alpha_Pd(8): Coefficient of the desired characteristic polynomial;
% alpha_Pd(9): Coefficient of the desired characteristic polynomial;
% alpha_Pd(10): Coefficient of the desired characteristic polynomial;
%
% Observation:
% "f" is the frequency of reference voltage of UPS [Hz];
% "Pout_nom" is the output apparent power of UPS [VA];
% "Vout_rms" is the output RMS voltage [V];
%
% The desired characteristic polynomial:
% 1 MODE:
% alpha_Pd(0)s^4 + alpha_Pd(1)s^3 + alpha_Pd(2)s^2 + alpha_Pd(3)s^1 + 
% alpha_Pd(4)
%
% 2 MODES:
% alpha_Pd(0)s^6 + alpha_Pd(1)s^5 + alpha_Pd(2)s^4 + alpha_Pd(3)s^3 + 
% alpha_Pd(4)s^2 + alpha_Pd(5)s^1 + alpha_Pd(6)
%
% 3 MODES:
% alpha_Pd(0)s^8 + alpha_Pd(1)s^7 + alpha_Pd(2)s^6 + alpha_Pd(3)s^5 + 
% alpha_Pd(4)s^4 + alpha_Pd(5)s^3 + alpha_Pd(6)s^2 + alpha_Pd(7)s^1 + 
% alpha_Pd(8)
%
% 4 MODES:
% alpha_Pd(0)s^10 + alpha_Pd(1)s^9 + alpha_Pd(2)s^8 + alpha_Pd(3)s^7 +
% alpha_Pd(4)s^6 + alpha_Pd(5)s^5 + alpha_Pd(6)s^4 + alpha_Pd(7)s^3 +
% alpha_Pd(8)s^2 + alpha_Pd(9)s^1 + alpha_Pd(10)
%
%
% OUTPUT:
% K_alt: The state-feedback gains
%
% EXAMPLES:
% 1 MODE:
% K_alt = tuning_method_n_modes (n_har,Cf,Lf,Rlf,wr,YY0max,Kpwm,csip1,csip3,csip5,csip7,alpha_Pd1,alpha_Pd2,alpha_Pd3,alpha_Pd4,alpha_Pd5,alpha_Pd6,alpha_Pd7,alpha_Pd8,alpha_Pd9,alpha_Pd10)
% K_alt = tuning_method_n_modes (1,3*10^(-4),1*10^(-3),15*10^(-3),376.9911,0.1519,1,0.007,0.000,0.000,0.000,6007.91,25129768.92,9565454702.23,3184394088587.22,0,0,0,0,0,0)
% K_alt = [k1 k2 k3 k4]
% K_alt = [-5.4813 5.6519 -288.3928 2574.1896]
%
% 2 MODES:
% K_alt = tuning_method_n_modes (n_har,Cf,Lf,Rlf,wr,YY0max,Kpwm,csip1,csip3,csip5,csip7,alpha_Pd1,alpha_Pd2,alpha_Pd3,alpha_Pd4,alpha_Pd5,alpha_Pd6,alpha_Pd7,alpha_Pd8,alpha_Pd9,alpha_Pd10)
% K_alt = tuning_method_n_modes (2,3*10^(-4),1*10^(-3),15*10^(-3),376.9911,0.1519,1,0.000,0.007,0.000,0.000,5998.86,26306330.81,16821057747.19,34969460842555.7,7.9069111274586e+015,4.324359254982e+018,0,0,0,0)
% K_alt = [k1 k2 k3 k4 k5 k6]
% K_alt = [-5.4617 5.6051 -74.1451 1487.8669 -117.721 889.051]
%
% 3 MODES:
% K_alt = tuning_method_n_modes (n_har,Cf,Lf,Rlf,wr,YY0max,Kpwm,csip1,csip3,csip5,csip7,alpha_Pd1,alpha_Pd2,alpha_Pd3,alpha_Pd4,alpha_Pd5,alpha_Pd6,alpha_Pd7,alpha_Pd8,alpha_Pd9,alpha_Pd10)
% K_alt = tuning_method_n_modes (3,3*10^(-4),1*10^(-3),15*10^(-3),376.9911,0.1519,1,0.000,0.000,0.003,0.000,6276.14,31316860.55,44351184275.18,133094737529310,7.85279734507947e+016,1.31261702819833e+020,2.8817715692564e+022,1.55518293456464e+025,0,0)
% K_alt = [k1 k2 k3 k4 k5 k6 k7 k8]
% K_alt = [-5.7435 6.0068 -101.7345 1433.9227 -253.6461 1416.9149 -309.3628 1011.6445]
%
% 4 MODES:
% K_alt = tuning_method_n_modes (n_har,Cf,Lf,Rlf,wr,YY0max,Kpwm,csip1,csip3,csip5,csip7,alpha_Pd1,alpha_Pd2,alpha_Pd3,alpha_Pd4,alpha_Pd5,alpha_Pd6,alpha_Pd7,alpha_Pd8,alpha_Pd9,alpha_Pd10)
% K_alt = tuning_method_n_modes (4,3*10^(-4),1*10^(-3),15*10^(-3),376.9911,0.1519,1,0.000,0.003,0.003,0.020,6388.38,39090923.12,92734244530.726,357710219240550,4.14686119679024e+017,1.07285752088783e+021,6.20752299091548e+023,9.409489318894e+026,2.23317109378592e+029, 1.09794096404003e+032)
% K_alt = [k1 k2 k3 k4 k5 k6 k7 k8 k9 k10]
% K_alt = [-5.7434 6.0381 -83.3865 1624.7038 -210.0964 1368.7902 -340.5869 1202.9585 -6.4276 -3.0634]

%% 
function K_alt = tuning_method_n_modes (n_har,Cf,Lf,Rlf,wr,YY0max,Kpwm,csip1,csip3,csip5,csip7,alpha_Pd1,alpha_Pd2,alpha_Pd3,alpha_Pd4,alpha_Pd5,alpha_Pd6,alpha_Pd7,alpha_Pd8,alpha_Pd9,alpha_Pd10)

% Tests the number of harmonics
if (n_har==1)
    
    k1 = (Lf*YY0max + Cf*Rlf - Cf*Lf*alpha_Pd1 + 2*Cf*Lf*csip1*wr)/(Cf*Kpwm);
    k2 = -(- 4*Lf*Cf^2*csip1^2*wr^2 + 2*Lf*alpha_Pd1*Cf^2*csip1*wr + Lf*Cf^2*wr^2 - Lf*alpha_Pd2*Cf^2 - 2*Lf*Cf*YY0max*csip1*wr + Lf*alpha_Pd1*Cf*YY0max + Cf - Lf*YY0max^2)/(Cf*Kpwm);
    k3 = (Cf*Lf*(- 4*csip1^2*wr^4 + 2*alpha_Pd1*csip1*wr^3 + wr^4 - alpha_Pd2*wr^2 + alpha_Pd4))/(Kpwm*wr);
    k4 = (Cf*Lf*(- 8*csip1^3*wr^3 + 4*alpha_Pd1*csip1^2*wr^2 + 4*csip1*wr^3 - 2*alpha_Pd2*csip1*wr - alpha_Pd1*wr^2 + alpha_Pd3))/Kpwm;

    K_alt = [k1 k2 k3 k4];
    
elseif (n_har==2)
    
    k1 = (Lf*YY0max + Cf*Rlf - Cf*Lf*alpha_Pd1 + 2*Cf*Lf*csip1*wr + 6*Cf*Lf*csip3*wr)/(Cf*Kpwm);
    k2 = (4*Lf*Cf^2*csip1^2*wr^2 + 12*Lf*Cf^2*csip1*csip3*wr^2 - 2*Lf*alpha_Pd1*Cf^2*csip1*wr + 36*Lf*Cf^2*csip3^2*wr^2 - 6*Lf*alpha_Pd1*Cf^2*csip3*wr - 10*Lf*Cf^2*wr^2 + Lf*alpha_Pd2*Cf^2 + 2*Lf*Cf*YY0max*csip1*wr + 6*Lf*Cf*YY0max*csip3*wr - Lf*alpha_Pd1*Cf*YY0max - Cf + Lf*YY0max^2)/(Cf*Kpwm);
    k3 = (Cf*Lf*(- 72*csip1^4*wr^6 + 24*csip3*csip1^3*wr^6 + 36*alpha_Pd1*csip1^3*wr^5 + 52*csip1^2*wr^6 - 12*csip3*alpha_Pd1*csip1^2*wr^5 - 18*alpha_Pd2*csip1^2*wr^4 + 2*alpha_Pd6*csip1^2 - 12*csip3*csip1*wr^6 - 17*alpha_Pd1*csip1*wr^5 + 6*csip3*alpha_Pd2*csip1*wr^4 + 9*alpha_Pd3*csip1*wr^3 - alpha_Pd5*csip1*wr - 6*csip3*alpha_Pd6*csip1 - 4*wr^6 + 3*csip3*alpha_Pd1*wr^5 + 4*alpha_Pd2*wr^4 - 3*csip3*alpha_Pd3*wr^3 - 4*alpha_Pd4*wr^2 + 3*csip3*alpha_Pd5*wr + 4*alpha_Pd6))/(2*Kpwm*wr^3*(9*csip1^2 - 30*csip1*csip3 + 9*csip3^2 + 16));
    k4 = (Cf*Lf*(- 144*csip1^5*wr^6 + 48*csip3*csip1^4*wr^6 + 72*alpha_Pd1*csip1^4*wr^5 + 140*csip1^3*wr^6 - 24*csip3*alpha_Pd1*csip1^3*wr^5 - 36*alpha_Pd2*csip1^3*wr^4 - 36*csip3*csip1^2*wr^6 - 52*alpha_Pd1*csip1^2*wr^5 + 12*csip3*alpha_Pd2*csip1^2*wr^4 + 18*alpha_Pd3*csip1^2*wr^3 - 25*csip1*wr^6 + 12*csip3*alpha_Pd1*csip1*wr^5 + 17*alpha_Pd2*csip1*wr^4 - 6*csip3*alpha_Pd3*csip1*wr^3 - 9*alpha_Pd4*csip1*wr^2 + alpha_Pd6*csip1 + 3*csip3*wr^6 + 4*alpha_Pd1*wr^5 - 3*csip3*alpha_Pd2*wr^4 - 4*alpha_Pd3*wr^3 + 3*csip3*alpha_Pd4*wr^2 + 4*alpha_Pd5*wr - 3*csip3*alpha_Pd6))/(2*Kpwm*wr^3*(9*csip1^2 - 30*csip1*csip3 + 9*csip3^2 + 16));
    k5 = -(Cf*Lf*(5832*csip3^4*wr^6 - 17496*csip1*csip3^3*wr^6 - 972*alpha_Pd1*csip3^3*wr^5 + 8748*csip3^2*wr^6 + 2916*csip1*alpha_Pd1*csip3^2*wr^5 + 162*alpha_Pd2*csip3^2*wr^4 - 18*alpha_Pd6*csip3^2 + 8748*csip1*csip3*wr^6 - 1701*alpha_Pd1*csip3*wr^5 - 486*csip1*alpha_Pd2*csip3*wr^4 - 27*alpha_Pd3*csip3*wr^3 + 27*alpha_Pd5*csip3*wr + 6*csip1*alpha_Pd6*csip3 - 2916*wr^6 - 729*csip1*alpha_Pd1*wr^5 + 324*alpha_Pd2*wr^4 + 81*csip1*alpha_Pd3*wr^3 - 36*alpha_Pd4*wr^2 - 9*csip1*alpha_Pd5*wr + 4*alpha_Pd6))/(6*Kpwm*wr^3*(9*csip1^2 - 30*csip1*csip3 + 9*csip3^2 + 16));
    k6 = -(Cf*Lf*(3888*csip3^5*wr^6 - 11664*csip1*csip3^4*wr^6 - 648*alpha_Pd1*csip3^4*wr^5 + 4860*csip3^3*wr^6 + 1944*csip1*alpha_Pd1*csip3^3*wr^5 + 108*alpha_Pd2*csip3^3*wr^4 + 8748*csip1*csip3^2*wr^6 - 972*alpha_Pd1*csip3^2*wr^5 - 324*csip1*alpha_Pd2*csip3^2*wr^4 - 18*alpha_Pd3*csip3^2*wr^3 - 3645*csip3*wr^6 - 972*csip1*alpha_Pd1*csip3*wr^5 + 189*alpha_Pd2*csip3*wr^4 + 54*csip1*alpha_Pd3*csip3*wr^3 + 3*alpha_Pd4*csip3*wr^2 - 3*alpha_Pd6*csip3 - 729*csip1*wr^6 + 324*alpha_Pd1*wr^5 + 81*csip1*alpha_Pd2*wr^4 - 36*alpha_Pd3*wr^3 - 9*csip1*alpha_Pd4*wr^2 + 4*alpha_Pd5*wr + csip1*alpha_Pd6))/(2*Kpwm*wr^3*(9*csip1^2 - 30*csip1*csip3 + 9*csip3^2 + 16));     
    
    K_alt = [k1 k2 k3 k4 k5 k6];
    
elseif (n_har==3)
    
    k1 = (Lf*YY0max + Cf*Rlf - Cf*Lf*alpha_Pd1 + 2*Cf*Lf*csip1*wr + 6*Cf*Lf*csip3*wr + 10*Cf*Lf*csip5*wr)/(Cf*Kpwm);
    k2 = (4*Lf*Cf^2*csip1^2*wr^2 + 12*Lf*Cf^2*csip1*csip3*wr^2 + 20*Lf*Cf^2*csip1*csip5*wr^2 - 2*Lf*alpha_Pd1*Cf^2*csip1*wr + 36*Lf*Cf^2*csip3^2*wr^2 + 60*Lf*Cf^2*csip3*csip5*wr^2 - 6*Lf*alpha_Pd1*Cf^2*csip3*wr + 100*Lf*Cf^2*csip5^2*wr^2 - 10*Lf*alpha_Pd1*Cf^2*csip5*wr - 35*Lf*Cf^2*wr^2 + Lf*alpha_Pd2*Cf^2 + 2*Lf*Cf*YY0max*csip1*wr + 6*Lf*Cf*YY0max*csip3*wr + 10*Lf*Cf*YY0max*csip5*wr - Lf*alpha_Pd1*Cf*YY0max - Cf + Lf*YY0max^2)/(Cf*Kpwm);
    k3 = -(Cf*Lf*(48*wr^2*alpha_Pd6 - 31*csip1^2*alpha_Pd8 - 4*csip1^4*alpha_Pd8 - 48*alpha_Pd8 - 48*wr^4*alpha_Pd4 + 48*wr^6*alpha_Pd2 - 48*wr^8 + 1249*csip1^2*wr^8 - 4364*csip1^4*wr^8 + 3600*csip1^6*wr^8 - csip1^2*wr^2*alpha_Pd6 + 225*csip1^2*wr^4*alpha_Pd4 - 641*csip1^2*wr^6*alpha_Pd2 - 450*csip1^3*wr^5*alpha_Pd3 + 1732*csip1^3*wr^7*alpha_Pd1 + 900*csip1^4*wr^6*alpha_Pd2 - 1800*csip1^5*wr^7*alpha_Pd1 + 1188*csip1^3*csip3*wr^8 + 700*csip1^3*csip5*wr^8 - 1200*csip1^5*csip3*wr^8 - 720*csip1^5*csip5*wr^8 + 69*csip1*csip3*alpha_Pd8 + 35*csip1*csip5*alpha_Pd8 + 15*csip3*csip5*alpha_Pd8 + 16*csip1*wr*alpha_Pd7 - 36*csip3*wr*alpha_Pd7 - 20*csip5*wr*alpha_Pd7 + 12*csip1^3*csip3*alpha_Pd8 + 20*csip1^3*csip5*alpha_Pd8 - 112*csip1*wr^3*alpha_Pd5 + 208*csip1*wr^5*alpha_Pd3 - 304*csip1*wr^7*alpha_Pd1 + 36*csip3*wr^3*alpha_Pd5 - 36*csip3*wr^5*alpha_Pd3 + 36*csip3*wr^7*alpha_Pd1 + 2*csip1^3*wr*alpha_Pd7 + 20*csip5*wr^3*alpha_Pd5 - 20*csip5*wr^5*alpha_Pd3 + 20*csip5*wr^7*alpha_Pd1 - 219*csip1*csip3*wr^8 - 125*csip1*csip5*wr^8 + 15*csip3*csip5*wr^8 - 60*csip1^2*csip3*csip5*alpha_Pd8 + 3*csip1*csip3*wr^2*alpha_Pd6 - 75*csip1*csip3*wr^4*alpha_Pd4 + 147*csip1*csip3*wr^6*alpha_Pd2 - 6*csip1^2*csip3*wr*alpha_Pd7 + 5*csip1*csip5*wr^2*alpha_Pd6 - 45*csip1*csip5*wr^4*alpha_Pd4 + 85*csip1*csip5*wr^6*alpha_Pd2 - 10*csip1^2*csip5*wr*alpha_Pd7 - 15*csip3*csip5*wr^2*alpha_Pd6 + 15*csip3*csip5*wr^4*alpha_Pd4 - 15*csip3*csip5*wr^6*alpha_Pd2 + 150*csip1^2*csip3*wr^5*alpha_Pd3 - 444*csip1^2*csip3*wr^7*alpha_Pd1 - 300*csip1^3*csip3*wr^6*alpha_Pd2 + 90*csip1^2*csip5*wr^5*alpha_Pd3 - 260*csip1^2*csip5*wr^7*alpha_Pd1 + 600*csip1^4*csip3*wr^7*alpha_Pd1 - 180*csip1^3*csip5*wr^6*alpha_Pd2 + 360*csip1^4*csip5*wr^7*alpha_Pd1 - 180*csip1^2*csip3*csip5*wr^8 + 240*csip1^4*csip3*csip5*wr^8 + 60*csip1^2*csip3*csip5*wr^6*alpha_Pd2 - 120*csip1^3*csip3*csip5*wr^7*alpha_Pd1 + 30*csip1*csip3*csip5*wr*alpha_Pd7 - 30*csip1*csip3*csip5*wr^5*alpha_Pd3 + 60*csip1*csip3*csip5*wr^7*alpha_Pd1))/(4*Kpwm*wr^5*(9*csip1^2 - 30*csip1*csip3 + 9*csip3^2 + 16)*(25*csip1^2 - 130*csip1*csip5 + 25*csip5^2 + 144));
